def myPlot(f_12, f_24, f_52,protocol,x):
    plt.plot(x, f_12, '-r', label='0 FAULTS. ')
    plt.plot(x, f_24, '-b', label='24 FAULTS. ')
    plt.plot(x, f_52, '-m', label='52 FAULTS. ')

    plt.legend()
    #plt.axvline(x=3, color='yellow')
    plt.ticklabel_format(axis='y', style='plain', useOffset=False)

    #plt.ylim(0, 1.1)
    plt.title(protocol)
    plt.xlabel("x dissemination times (sec)")
    plt.ylabel("y reliabilities (%)")

    plt.show()


def myPlot2(f_12, f_24, f_52, protocol, x):
    plt.plot(x, f_12, '-r', label='0 FAULTS. ')
    plt.plot(x, f_24, '-b', label='24 FAULTS. ')
    plt.plot(x, f_52, '-m', label='52 FAULTS. ')

    plt.legend()
    # plt.axvline(x=3, color='yellow')
    plt.ticklabel_format(axis='y', style='plain', useOffset=False)

    # plt.ylim(0, 1.1)
    plt.title(protocol)
    plt.xlabel("x dissemination times (sec)")
    plt.ylabel("y latencies (ms)")

    plt.show()


